script: |
  super -f text -I q13188.spq | sort > q13188.out

inputs:
  - name: q13188.spq
    data: |
      SELECT DISTINCT + ( - + 80 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 IN ( col0, col0 - - col2 + - col0 * 12 / 33 - - col1 * + col1 + + col2 );
  - name: tab2

outputs:
  - name: q13188.out
    data: |
      -80
